</template>

<script>
import { MessageBox, Toast } from "mint-ui";
// import sanImg from "../assets/img/山2@3x.png";
export default {
  data() {
    return {
      //   san: sanImg,
      testNum: 0,
      PageId: 0,
      orderList: [],
      lookHide: true,
      startX: 0, //触摸位置
      endX: 0, //结束位置
      moveX: 0, //滑动时的位置
      disX: 0, //移动距离
      deleteSlider: "", //滑动时的效果,使用v-bind:style="deleteSlider"
      id: -1
    };
  },
  computed: {
    uid() {
      return this.$store.state.useMessage.mem_id;
    }
  },
  methods: {
    rePersonalCenter() {
      this.$router.push({
        name: "personalCenter"
      });
    },
    reShortcutPhone() {
      this.$router.push({
        name: "shortcutPhone"
      });
    },

    reQuickQuestion() {
      this.$router.push({
        name: "quickQuestion"
      });
    },

    reSearchMaster() {
      this.$router.push({
        name: "searchMaster"
      });
    },

    reTopic() {
      this.$router.push({
        name: "topic"
      });
    },

    touchStart(ev, id) {
      ev = ev || event;

      if (ev.touches.length == 1) {
        this.startX = ev.touches[0].clientX;
      }
    },
    touchMove(ev, id) {
      ev = ev || event;

      console.log(this.$refs);
      let wd = this.$refs.remove.offsetWidth;
      if (ev.touches.length == 1) {
        this.moveX = ev.touches[0].clientX;

        this.disX = this.startX - this.moveX;
        console.log(this.disX);

        if (this.disX < 0 || this.disX == 0) {
          this.id = -1;
          this.deleteSlider = "transform:translateX(0px)";
        } else if (this.disX > 0) {
          this.id = id;

          this.deleteSlider = "transform:translateX(-" + this.disX * 5 + "px)";

          if (this.disX * 5 >= wd) {
            this.deleteSlider = "transform:translateX(-" + wd + "px)";
          }
        }
      }
    },
    touchEnd(ev) {
      ev = ev || event;
      let wd = this.$refs.remove.offsetWidth;
      if (ev.changedTouches.length == 1) {
        let endX = ev.changedTouches[0].clientX;

        this.disX = this.startX - endX;
        console.log(this.disX);

        if (this.disX * 5 < wd / 2) {
          this.deleteSlider = "transform:translateX(0px)";
          this.id = -1;
        } else {
          this.deleteSlider = "transform:translateX(-" + wd + "px)";
        }
      }
    },

    del(id) {
      console.log(id);
      var that = this;
      MessageBox.confirm("您确认要删除吗")
        .then(action => {
          that.$http
            .post("false_del_order", {
              ord_id: id,
              token: that.$store.state.useMessage.token
            })
            .then(res => {
              if (res.data.code == 200) {
                Toast({
                  message: "删除成功",
                  position: "bottom",
                  duration: 1000
                });
              }
              that.orderList = that.orderList.filter(item => {
                return item.id != id;
              });
            });
        })
        .catch(() => {});
    },

    getHomeOrder(mem_id, PageId, token) {
      this.$http
        .post("home_list", { mem_id: mem_id, PageId: PageId, token: token })
        .then(res => {
          if (res.data.code == 200) {
            var arr = res.data.data;
            arr.forEach(element => {
              this.orderList.push(element);
            });
          } else {
            this.lookHide = false;
          }
        });
    },

    getMoreOrder() {
      this.PageId++;
      this.getHomeOrder(
        this.uid,
        this.PageId,
        this.$store.state.useMessage.token
      );
    },

    reOrderDetail(id, status) {
      if (status === 3) {
        this.$router.push({ name: "orderFinshed", query: { id: id } });
      } else {
        this.$router.push({ name: "orderDetail", query: { id: id } });
      }
    }
  },
  created() {
    this.$http.post("yesterday_num").then(res => {
      this.testNum = res.data.data;
    });
    if (this.$store.state.useMessage.token) {
      this.getHomeOrder(
        this.uid,
        this.PageId,
        this.$store.state.useMessage.token
      );
    }

    localStorage.setItem("homeUrl", window.location.href);
  }
};
</script>

